   distance = math.sqrt((basket_patch.horizontal_center - bowl_patch.horizontal_center) ** 2 + (basket_patch.vertical_center - bowl_patch.vertical_center) ** 2)
   if distance < 100:
       return basket_patch.simple_query("What is inside the basket?")
   else:
       return bowl_patch.simple_query("What is inside the bowl?")

